import React from 'react';

//function Alert({type,message}) 
function Alert(props) {
  console.log(props);

  return (
    //user alert and have the class but if no type default to success; || "short circuiting" - if left is true, sho w that, if left is false, show right side
    //template literal 
    <div className={`alert alert-${props.type || 'success'}`} role="alert">
      {props.message}
    </div>
  );
}

export default Alert;
